import React from 'react';
import ReactDOM from 'react-dom';
import {add,sub,mul,div} from './Calculator';

ReactDOM.render(
    <>
    <ul>
        <li>{add(40,4)}</li>
        <li>{sub(30,3)}</li>
        <li>{mul(12,6)}</li>
        <li>{div()}</li>
    </ul>
    </>,
    document.getElementById("root")

);
